const Home = () => {
  return (
      <div class="App">
          <div class="TextBox">
            <h1 class="MainTitle">TicTacToe</h1>
            <p class="SubTitle">Three in a Row</p>
              <a href="game"><button id="PlayButton">Play Now</button></a>
              <a href="help"><button id="HelpButton">Help</button></a>
          </div>
      </div>
  );
};

export default Home;
